import React from "react";
import { Box, Typography, Avatar } from "@mui/material";

const AboutMe = () => {
  return (
    <Box p={3} display="flex" flexDirection="column" alignItems="center">
      <Avatar
        sx={{ width: 56, height: 56, mb: 2 }}
        src="/path_to_your_image.jpg"
      />
      <Typography variant="h5">Sebastian Berge</Typography>
      <Typography paragraph align="center" sx={{ maxWidth: 600 }}>
        Hello! I'm a Senior Cloud & DevOps Engineer with over 4 years of
        experience specializing in the Cloud and DevOps fields.
      </Typography>
    </Box>
  );
};

export default AboutMe;
